INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1001, 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 2, 0, 0, 1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, 1, "春咲 ひより", "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1002, 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 1.4, 2, 0, 0, 1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, 1, "草野 優衣", "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1003, 1, 0, "フェンシングを始めてみては？", 1.4, 2, 0, 0, 1, "少しは磨かれると思いますよ。", 0, 1, "士条 怜", "キミに必要な集中力と感性が");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1004, 1, 0, "ねぇ、にいちゃん！", 1.5, 2, 0, 0, 1, "みそぎはねぇ、\nかくれんぼやりたい！", 0, 1, "穂高 みそぎ", "今日はなにして遊ぶ？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1006, 1, 0, "風宮あかりです", 1.4, 2, 0, 0, 1, "私といっしょに…\nいかない？", 0, 1, "風宮 あかり", "ねぇ…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1007, 1, 0, "出雲宮子なのー", 1.5, 2, 0, 0, 1, "食べ物の恨みは怖いのー", 0, 1, "出雲 宮子", "プリンたべたいのー");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1008, 1, 0, "ボクは虹村雪。", 1.4, 2, 0, 0, 1, "いいよ。\n見られることは運命さ…", 0, 1, "虹村 雪", "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1009, 1, 0, "フッ…聞いて後悔するがいい！", 1.4, 2, 0, 0, 1, "人呼んで「疾風の冥姫」!!", 0, 1, "柊杏奈", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1010, 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 2, 0, 0, 1, "ほんまおおきにやわ～♪", 0, 1, "姫宮 真歩", "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1011, 1, 0, "衣之咲璃乃です！", 1.4, 2, 0, 0, 1, "ここで会ったが\n100年目～！", 0, 1, "衣之咲 璃乃", "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1012, 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 2, 0, 0, 1, "…って、お願い！\n誰にも言わないでおいて～！", 0, 1, "柏崎 初音", "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1016, 1, 0, "ちょす！\n美波鈴奈だよ～♪", 1.4, 2, 0, 0, 1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, 1, "美波 鈴奈", "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1017, 1, 0, "はいたーい。\n喜屋武香織さー。", 1.4, 2, 0, 0, 1, "でも、沖縄もとってもいいとこさー", 0, 1, "喜屋武 香織", "東京は遊園地みたいなところさー");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1018, 1, 0, "支倉伊緒です。", 1.4, 2, 0, 0, 1, "イオちゃんって呼んでね。", 0, 1, "支倉 伊緒", "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1020, 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 2, 0, 0, 1, "ミミをおいてかないでぇ～", 0, 1, "茜 ミミ", "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1021, 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 2, 0, 0, 1, "ふぇぇぇぇぇん……", 0, 1, "栗林 くるみ", "あの……\nふぇ……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1022, 1, 0, "風宮よりです。\nあああああ！", 1.4, 2, 0, 0, 1, "なんてありがとうございます！", 0, 1, "風宮 より", "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1023, 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 2, 0, 0, 1, "私こっち行きたいー\nね、早く早くー", 0, 1, "北条 綾音", "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1025, 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 1.4, 2, 0, 0, 1, "これて何か違う…\nあああすみません！", 0, 1, "天野 すずめ", "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1027, 1, 0, "……クスクス…私は\n…倉石恵理子……", 1.4, 2, 0, 0, 1, "離しませんわ………\n絶対に…!!", 0, 1, "倉石 恵理子", "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1028, 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 2, 0, 0, 1, "…そうでしょ？？", 0, 1, "佐々木 咲恋", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1029, 1, 0, "桜井望だよ！\nよろしくねっ", 1.4, 2, 0, 0, 1, "あはは、\n私もまだまだだなぁ～", 0, 1, "桜井 望", "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1030, 1, 0, "デケデケデンっ！", 1.4, 2, 0, 0, 1, "ショーグン、\nワタシと一緒に天下統一デース！", 0, 1, "ニノン・ジュベール", "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1031, 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 1.4, 2, 0, 0, 1, "おかしいですね……", 0, 1, "上喜 しのぶ", "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1033, 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 2, 0, 0, 1, "そう、\nオラのボケに突っ込める相方が…！", 0, 1, "野戸まひる", "けんども\nそれには足りないモンが…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1034, 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 2, 0, 0, 1, "ちょ\nちょっと一杯飲んできます…！", 0, 1, "綾瀬 ゆかり", "ちょっと緊張しちゃって…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1036, 1, 0, "氷川鏡華…です", 1.5, 2, 0, 0, 1, "これ以上お話しすることは…\nないです！", 0, 1, "氷川 鏡華", "知らない人とは話しちゃいけないので");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1038, 1, 0, "柏崎…栞です。", 1.4, 2, 0, 0, 1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, 1, "柏崎 栞", "……あ、アラーム。");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1040, 1, 0, "ふ、双葉碧です。", 1.4, 2, 0, 0, 1, "野に咲く花が、\n唯一の話相手です。", 0, 1, "双葉 碧", "私、一人も友達がいなくて……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1042, 1, 0, "三角千歌です。", 1.4, 2, 0, 0, 1, "そう思っています。", 0, 1, "三角 千歌", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1043, 1, 0, "安芸真琴だ。", 1.4, 2, 0, 0, 1, "う、疑ってすまなかったな…", 0, 1, "安芸 真琴", "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1044, 1, 0, "わらわこそは夜を総べる者！", 1.4, 2, 0, 0, 1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, 1, "イリヤ・オーンスタイン", "生けとし生ける全ての者よ！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1045, 1, 0, "そこで騎士は妖精を乱暴に……", 1.4, 2, 0, 0, 1, "ｌク、クウカに何かご用ですか!?", 0, 1, "遠見 空花", "ぐふふふふ……はっ！");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1046, 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 2, 0, 0, 1, "う～ん…\n猫ってホントに最高にゃ～♪", 0, 1, "宮坂たまき", "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1048, 1, 0, "大神美冬よ！", 1.4, 2, 0, 0, 1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, 1, "大神 美冬", "それでは早速クエストに…");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1049, 1, 0, "星野静流だよ！", 1.4, 2, 0, 0, 1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, 1, "星野静流", "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1050, 1, 0, "アタシは玉泉美咲。", 1.5, 2, 0, 0, 1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, 1, "玉泉美咲", "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1052, 1, 0, "？？？", 1.4, 2, 0, 0, 1, "？？？？", 0, 1, "リマ", "？？？？");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1053, 1, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 2, 0, 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1, "モニカ・ヴァイスヴィント", "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1058, 1, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 2, 0, 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1, "ペコリーヌ", "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1059, 1, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 2, 0, 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1, "コッコロ", "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_0157e7afa6bb1be9e4520b2fb98ae11cab6951073982e8deb653946a4fba4e8a` VALUES (0, 1060, 1, 0, "モニカ・ヴァイスヴィントだ。", 1.5, 2, 0, 0, 1, "そ、そこまでいうなら\nもらってやる", 0, 1, "キャル", "菓子でつろうなどと\n稚拙な策を……");
